export default function deleteInfoFromDB(e){let t=localStorage.getItem("token");return fetch("https://ajax.test-danit.com/api/cards/"+e,{method:"DELETE",headers:{Authorization:"Bearer "+t,"Content-Type":"application/json;charset=utf-8"}}).then(e=>{e.text()}).catch(e=>{console.log("message of Delete request: ",e.message)})}